void proc_control::proc_control_binary_expand_op_p(boolean_T in1[8], const
  real_T in2[128], int32_T in3, const uint16_T in4[8], const
  mpcManager_proc_control_T *in5)
{
  int32_T stride_0_1;

  // Outputs for Atomic SubSystem: '<Root>/Subsystem Controller'
  // Outputs for Enabled SubSystem: '<S7>/MPC manager' incorporates:
  //   EnablePort: '<S128>/Enable'

  // MATLABSystem: '<S128>/MPC manager' incorporates:
  //   Delay: '<S7>/Delay'

  stride_0_1 = (in3 != 1);
  for (int32_T i{0}; i < 8; i++) {
    real_T tmp;
    uint16_T tmp_0;
    tmp = std::round(static_cast<real_T>(in4[i]) * in5->MPC.thrusters.faultThres);
    if (tmp < 65536.0) {
      if (tmp >= 0.0) {
        tmp_0 = static_cast<uint16_T>(tmp);
      } else {
        tmp_0 = 0U;
      }
    } else {
      tmp_0 = MAX_uint16_T;
    }

    in1[i] = (in2[i * stride_0_1] < tmp_0);
  }

  // End of MATLABSystem: '<S128>/MPC manager'
  // End of Outputs for SubSystem: '<S7>/MPC manager'
  // End of Outputs for SubSystem: '<Root>/Subsystem Controller'
}

